In optimization, the aim is to determine a best solution from a set of options for a specific problem [

 1

]. Mathematically, optimization problems consist of decision variables, constraints, and one or several objective functions. The objective is to assign appropriate values to the decision variables in order to maximize or minimize the objective function while adhering to the problem's constraints [

 2

]. Regarding such optimization problems, problem solving techniques can be partitioned into two main groups: deterministic and stochastic approaches [

 3

]. Deterministic methods are particularly useful for solving linear, convex, low-dimensional, continuous, and differentiable problems [

 4

]. However, as problems become more intricate and dimensions increase, deterministic approaches may struggle with being trapped in local optima and providing suboptimal solutions [

 5

]. Conversely, within science, engineering, industry, technology, and practical applications, numerous intricate optimization problems exist that are characterized as non-convex, non-linear, discontinuous, non-differentiable, complex, and high-dimensional. Due to the inefficiencies and challenges associated with deterministic methods in addressing these optimization issues, scientists have turned to developing stochastic approaches [

 6

].

Metaheuristic algorithms stand out as highly effective stochastic methods capable of offering viable solutions for optimization challenges, all without requiring derivative information. They rely on random exploration within the solution space, utilizing random operators and trial-and-error strategies. Their advantages include straightforward concepts, straightforward implementation, proficiency in tackling varied optimization problems, no matter how complex or high-dimensional they may be, as well as adaptability to nonlinear and unfamiliar search spaces. As a result, the popularity and extensive use of metaheuristic algorithms continue to grow [

 7

]. In metaheuristic algorithms, the optimization process begins by randomly generating a set of candidate solutions at the start of the algorithm. These candidate solutions are then enhanced and modified by the algorithm during a certain number of iterations following its implementation steps. Upon completion of the algorithm, the best candidate solution found during its execution is put forward as the proposed solution to the problem [

 8

]. This random search element in metaheuristic algorithms means that achieving a global optimum cannot be guaranteed using these methods. Nonetheless, the solutions derived from these algorithms, being near the global optimum, are deemed acceptable as quasi-optimal solutions [

 9

].

For a metaheuristic algorithm to effectively carry out the optimization process, it needs to thoroughly explore the solution space on both a global and local scale. Global searching, through exploration, allows the algorithm to pinpoint the optimal area by extensively surveying all parts of the search space and avoiding narrow solutions. Local searching, through exploitation, helps the algorithm converge to solutions near a global optimum by carefully examining surrounding areas and promising solutions. Success in the optimization process hinges on striking a balance between exploration and exploitation during the search [

 10

]. Researchers' desire to improve optimization outcomes has resulted in the development of many metaheuristic algorithms. These metaheuristic algorithms are employed to deal with optimization tasks in various sciences and applications such as: engineering [

 11

], data mining [

 12

], wireless sensor networks [

 13

], internet of things [

 14

], etc.

The key question at hand is whether, based on the available metaheuristic algorithms, there remains a need in scientific research to develop new metaheuristic algorithms. The concept of No Free Lunch (NFL) [

 15

] addresses this by highlighting that while a metaheuristic algorithm may perform well in solving a particular set of optimization problems, it might not guarantee the same solution quality for different optimization problems. The NFL theorem suggests that there is no one-size-fits-all optimal metaheuristic algorithm for all types of optimization problems. It is conceivable that an algorithm may efficiently reach a global optimum for one problem but struggle to do so for another, possibly getting stuck at a local optimum. As a result, the success or failure of employing a metaheuristic algorithm for an optimization problem cannot be definitively assumed.

So far, several algorithms inspired by lizards have been introduced and designed. The strategy of Redheaded Agama lizards when hunting their prey has been the main idea of Artificial Lizard Search Optimization (ALSO). The concept originates from a recent study, where researchers observed that the lizards regulate the movement of their tails with precision, redirecting the angular momentum from their bodies to their tails. This action stabilizes their body position in the sagittal plane [

 16

]. The Side-Blotched Lizard Algorithm (SBLA) is an algorithm inspired by lizards, the main idea in its design is derived from the mating process of these lizards as well as imitating their polymorphic population [

 17

]. The Horned Lizard Optimization Algorithm (HLOA) is another algorithm inspired by lizards. The main source of inspiration in the HLOA design is derived from crypsis, skin darkening or lightening, blood-squirting, and move-to-escape defense methods [

 18

]. As it is evident, although from the point of view of the type of living organism, all these algorithms are inspired by lizards, but they have major differences in the details and also in the mathematical model.

Metaheuristic algorithms are devised by drawing inspiration from a diverse array of sources, including natural phenomena, behaviors exhibited by living organisms in their natural habitats, principles from biological sciences, genetic mechanisms, physical laws, human behavior, and various evolutionary processes. These algorithms are typically classified into four distinct groups, each based on the specific inspiration behind its design. These categories include swarm-based approaches, evolutionary-based approaches, physics-based approaches, and human-based approaches, with each group leveraging different principles and mechanisms to guide the optimization process [

 19

].

Swarm-based metaheuristic algorithms derive their principles from the collective behaviors and strategies observed in various natural systems, especially those exhibited by animals, aquatic creatures, and insects in their natural environments. These algorithms aim to mimic the efficient problem-solving strategies seen in nature to address complex optimization challenges. Among the most commonly used swarm-based metaheuristics are Particle Swarm Optimization (PSO) [

 20

], Ant Colony Optimization (ACO) [

 21

], Artificial Bee Colony (ABC) [

 22

], and Firefly Algorithm (FA) [

 23

]. PSO is inspired by the social behavior and collective movement patterns of birds flocking and fish schooling as they search for food. This algorithm simulates how individuals within a group adjust their positions based on personal experience and the success of their neighbors to find optimal solutions. ACO emulates the foraging behavior of ants, particularly how they find the shortest path between their nest and a food source by laying down and following pheromone trails. This method effectively models the way ants collectively solve complex routing problems through simple, local interactions. ABC is modeled after the foraging behavior of honey bees. It simulates how bees search for nectar, share information about food sources, and optimize their foraging strategies to maximize the efficiency of the colony. The Firefly Algorithm draws its inspiration from the bioluminescent communication of fireflies. It uses the concept of light intensity to simulate attraction among fireflies, guiding the search for optimal solutions through simulated social interactions. Furthermore, natural behaviors such as foraging, hunting, migration, digging, and chasing have inspired the development of various other metaheuristic algorithms. Examples include: Greylag Goose Optimization (GGO) [

 1

], African Vultures Optimization Algorithm (AVOA) [

 24

], Marine Predator Algorithm (MPA) [

 25

], Gooseneck Barnacle Optimization Algorithm (GBOA) [

 26

], Grey Wolf Optimizer (GWO) [

 27

], electric eel foraging optimization (EEFO) [

 28

], White Shark Optimizer (WSO) [

 29

], Crested Porcupine Optimizer (CPO) [

 30

], Tunicate Swarm Algorithm (TSA) [

 31

], Orca Predation Algorithm (OPA) [

 32

], Honey Badger Algorithm (HBA) [

 33

], Reptile Search Algorithm (RSA) [

 34

], Golden Jackal Optimization (GJO) [

 35

], and Whale Optimization Algorithm (WOA) [

 36

].

Evolutionary-based metaheuristic algorithms are inspired by fundamental principles from genetics, biology, natural selection, survival of the fittest, and Darwin's theory of evolution. These algorithms model natural evolutionary processes to solve complex optimization problems effectively. Among the most notable examples in this category are Genetic Algorithm (GA) [

 37

] and Differential Evolution (DE) [

 38

], which have gained widespread popularity and adoption. Genetic Algorithms (GA) simulate the process of natural selection where the fittest individuals are selected for reproduction in order to produce the next generation. This algorithm involves mechanisms such as selection, crossover (recombination), and mutation to evolve solutions to optimization problems over successive generations. By mimicking biological evolution, GAs can efficiently explore and exploit the search space to find optimal or near-optimal solutions. Differential Evolution (DE) is another powerful evolutionary algorithm that optimizes a problem by iteratively trying to improve candidate solutions with regard to a given measure of quality. DE uses operations like mutation, crossover, and selection, drawing inspiration from the biological evolution and genetic variations observed in nature. The algorithm is particularly effective for continuous optimization problems due to its simple yet robust strategy. Additionally, Artificial Immune Systems (AIS) algorithms are inspired by the human immune system's ability to defend against pathogens. AIS algorithms mimic the immune response process, learning and adapting to recognize and eliminate foreign elements. This approach provides robust mechanisms for optimization and anomaly detection [

 39

]. Other prominent members of evolutionary-based metaheuristics include Genetic programming (GP) [

 40

], Cultural Algorithm (CA) [

 41

], and Evolution Strategy (ES) [

 42

]. These evolutionary-based metaheuristics emulate natural processes to harness the power of evolution, providing versatile and powerful tools for solving a wide range of optimization problems in various domains.

Physics-based metaheuristic algorithms are introduced, drawing inspiration from the modeling of forces, laws, phenomena, and other fundamental concepts in physics. Simulated Annealing (SA) [

 43

] , a widely employed physics-based metaheuristic algorithm, takes its design cues from the physical phenomenon of metal annealing. This process involves the melting of metals under heat, followed by a gradual cooling and freezing process to attain an ideal crystal structure. Gravitational Search Algorithm (GSA) [

 44

] is crafted by modeling physical gravitational forces and applying Newton's laws of motion. Concepts derived from cosmology and astronomy serve as the foundation for algorithms like Multi-Verse Optimizer (MVO) [

 45

] and Black Hole Algorithm (BHA) [

 46

]. Some other physics-based metaheuristic algorithms are: Thermal Exchange Optimization (TEO) [

 47

], Prism Refraction Search (PRS) [

 48

], Equilibrium Optimizer (EO) [

 49

], Archimedes Optimization Algorithm (AOA) [

 50

], Lichtenberg Algorithm (LA) [

 51

], Water Cycle Algorithm (WCA) [

 52

], and Henry Gas Optimization (HGO) [

 53

].

Teaching-Learning Based Optimization (TLBO) [

 54

] is a prominent example of a human-based metaheuristic. TLBO simulates the teaching and learning processes in a classroom setting, modeling the interactions between teachers and students as well as peer learning among students. The algorithm improves solutions by mimicking the educational process where knowledge is imparted from teachers to students and shared among students, leading to enhanced performance and optimization outcomes. The Mother Optimization Algorithm (MOA) is inspired by the nurturing and caring behaviors exhibited by mothers, specifically modeled on Eshrat's care for her children. This algorithm utilizes the principles of guidance, protection, and nurturing to iteratively improve solutions, reflecting the natural and effective strategies mothers use in raising their offspring [

 9

]. War Strategy Optimization (WSO) takes its cue from the tactical and strategic movements of soldiers during ancient battles. By simulating various military strategies, formations, and maneuvers, WSO effectively explores and exploits the search space, providing robust solutions to complex problems [

 55

]. Poor and Rich Optimization (PRO) [

 56

] is designed based on the socioeconomic dynamics between the rich and the poor in society. This algorithm models the efforts of individuals to improve their financial and economic status, capturing the diverse strategies employed by different socioeconomic groups to achieve better outcomes. Some other human-based metaheuristic algorithms are: Coronavirus Herd Immunity Optimizer (CHIO) [

 57

], Gaining Sharing Knowledge based Algorithm (GSK) [

 58

], and Ali Baba and the Forty Thieves (AFT) [

 59

].

The frilled lizard (Chlamydosaurus kingii), is a species of lizard from the family Agamidae, which is native to southern New Guinea and northern Australia [

 60

]. The frilled lizard is an arboreal species and diurnal that spends more than 90% of each day up in the trees [

 61

]. During the short time that this animal is on the ground, it is busy with feeding, socializing or traveling to a new tree [

 60

]. A frilled lizard can move bipedally and do this when hunting or escaping from predators. To keep balanced, it leans its head far back enough, so it lines up behind the tail base [

 60

,

 62

]. The total length of the frilled lizard is about 90 centimeters, a head-body length of 27 centimeters, and weighs up to 600 grams [

 63

]. The frilled lizard has a special wide and big head with a long neck to accommodate the frill. It has long legs for running and a tail that makes most of the total length of this animal [

 64

]. The male species is larger than the female species and has proportionally bigger jaw, head, and frill [

 65

]. A picture of a frilled lizard is shown in

 Fig. 1

.

The main diet of the frilled lizard are insects and other invertebrates, although it also rarely feeds on vertebrates. Prominent prey includes centipedes, ants, termites, and moth larvae [

 66

]. The frilled lizard is a sit-and-wait predator that looks for potential prey. After seeing the prey, the frilled lizard runs fast on two legs and attacks the prey to catch it and feed on it. After feeding, the frilled lizard retreats back up a tree [

 60

].

